import React from 'react';
import './App.css';
import { Login1 } from './Paginas/Login1/Login1';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
          <Route exact path="/" component={Login1}/>



          <Route path="*">
            <h1>Not Found</h1>
          </Route>
      </Switch>
    </Router>
  );
}

export default App;
